import React from 'react'
import { Image, StyleSheet, View } from 'react-native'
import { hottel } from '../../assets'

const Navbar = () => {
  return (
    <View style={Styles.container}>
        jos
        <Image source={hottel} />
    </View>
  )
}

const Styles = StyleSheet.create({
    container : {
        height : 50, 
        backgroundColor : '#448f92'
    }
})

export default Navbar
